import React, { useState, useEffect } from 'react';
import axios from 'axios';

const GetMostCommonIngredients = () => {
    const [ingredients, setIngredients] = useState([]);

    useEffect(() => {
        axios.get('http://127.0.0.1:8000/api/common-ingredients/')
            .then(response => setIngredients(response.data))
            .catch(error => console.error('Error fetching common ingredients:', error));
    }, []);

    return (
        <div>
            <h2>Most Common Ingredients</h2>
            <ul>
                {ingredients.map((ingredient, index) => (
                    <li key={index}>{ingredient.ingredients} ({ingredient.count} times)</li>
                ))}
            </ul>
        </div>
    );
};

export default GetMostCommonIngredients;
